import React from 'react'
import APP from '../../assets/cv.pdf';

const CTA = () => {
  return (
    <div className="cta">
        <a herf={APP} download className='btn'>Download APP</a>
        <a herf='#contact' className='btn btn-primary'>Let's Talk</a>
    </div>
  )
}

export default CTA
